		body: '## [32.0.0](https://github.com/renovatebot/renovate/compare/31.97.3...32.0.0) (2022-03-04)\r\n\r\n\r\n###  BREAKING CHANGES\r\n\r\n* **gradle:** Option `deepExtract` is now removed and will be ignored\r\n* These changes affect only those who use Renovate as a *library* in other projects:\r\n  * Use `packageName` instead of `lookupName` if interacting with Renovate datasources directly.\r\n  * External tools must update paths to datasource, manager, platform and versioning\r\n\r\n### Features\r\n\r\n* **gradle:** remove deepExtract ([#14497](https://github.com/renovatebot/renovate/issues/14497)) ([8bd77f7](https://github.com/renovatebot/renovate/commit/8bd77f747b3da59cc955b2fc4ba3301bcb680ea2))\r\n\r\n### Code Refactoring\r\n\r\n* lib/modules ([#14488](https://github.com/renovatebot/renovate/issues/14488)) ([dca3418](https://github.com/renovatebot/renovate/commit/dca3418bbdbf1024ac6807e591562b4042bc846d))\r\n* rename lookupName -> packageName ([#14494](https://github.com/renovatebot/renovate/issues/14494)) ([143c9a6](https://github.com/renovatebot/renovate/commit/143c9a67516180e364e7a0881b1d9ac4d3fb1b17))\r\n* repository worker ([#14489](https://github.com/renovatebot/renovate/issues/14489)) ([a61821b](https://github.com/renovatebot/renovate/commit/a61821bde86356cde61d56e2ab2373366af01cb1))\r\n\r\n',
